import { useEffect } from "react";

const Home = () => {

    const loadPokemons = () => {
        fetch('https://pokeapi.co/api/v2/pokemon?limit=20')
        .then(response => response.json())
        .then(data => console.log(data))
    }

    useEffect(() => {
        loadPokemons()
    })

    return ( 
        <div>Teste</div>
    );
}

export default Home;
